user/templating/Overview.html.body:
Templating
All the templates for patterns are written with the nunjucks template engine (similar to Jinja and Twig). The main benefit of nunjucks is that it is easily customizable via filters and custom tags. 
The base system comes with a couple of filters that will help you build cms independant patterns while allowing you to export them to different target systems.
Patterns
Patterns are created by providing a nunjucks macros that render the patterns as html. Macros allow you to provide parameters to your patterns.
With parameters it's quite easy to encapsulate variations of patterns.


multiple macros per pattern
main macro = entity id
auto includes
models
examples

Entoj expects at least one macro that should be named like the directory it is living in. 
/site
    /atoms
        /a-cta
            /a-cta.j2 contains a macro a_cta
Example:
{##
    @param {String} [text] - The headline text
    @param {String} [classes] - Any additional classes that will be added to the root element
#}
{% macro a_text(text, classes='') %}

        {{ text }}

{% endmacro %}

Usage:
{{ a_text('Hi') }}

Nunjucks even allows you to create patterns that "wrap" other patterns. 
Example:
{##
    @param {String} [classes] - Any additional classes that will be added to the root element
#}
{% macro a_link(classes='') %}

        {{ caller }}

{% endmacro %}

Usage:
{% call a_link() %}
    {{ a_text('Hi') }}
{% endcall %}

As you may have noticed the macro parameters are documented with jsdoc. This allows entoj to parse the macros and provide the gathered meta data to interested plugins like exporters or the gui. 
Layouts
Pages
Pages are used to create mockup pages consisting of a layout and your patterns.
Example:
{% extends '/base/templates/t-default' %}
{% block content %}
    {% call a_link() %}
        {{ a_text('Hi') }}
    {% endcall %}
{% endblock %}

user/templating/Filters.html.body:
Filters
Filter are used to encapsulate common functionalities and make them transferable to target plattforms via template exports. 
The configuration of the filters is done in entoj-configuration.js.
Urls 
AssetUrlFilter 

Name: assetUrl
Parameters: None
Returns: String
Configuration:
baseUrl: StringThe base url to build the assets url. Defaults to /.



Generates a url for the given asset name.
Example:
    {{ 'someasset.gif'|assetUrl }}
    {# => base/url/someasset.gif #}

LinkUrlFilter 

Name: linkUrl or link
Parameters: None
Returns: String
Configuration:
dataProperties: ArrayA list of properties that will be used as the url when the filter was used on a object. Defaults to ['url']



Generates a url for the given link. If this fails JavaScript:; is returned as a default.
Example:
    {{ '/hi/there'|linkUrl }}
    {# => /hi/there #}

    {{ { url: '/hi/there' }|linkUrl }}
    {# => /hi/there #}

SVG 
SvgUrlFilter 

Name: svgUrl
Parameters: None
Returns: String
Configuration:
baseUrl: StringThe base url to build the svg url. Defaults to /.



Generates a url for the given svg name. This filter assumes that the svg contains a symbol name icon and is used via .
Example:
    {{ 'close'|svgUrl }}
    {# => /close.svg#icon #}

SvgViewBoxFilter 

Name: svgViewBox
Parameters: None
Returns: String
Configuration:
basePath: StringThe base path relative to ${sites} to build the svg file path. Defaults to /.



Reads the viewBox of the given svg name. When the svg contains no viewBox 0 0 0 0 is returned as the default.
Example:
    {{ 'close'|svgViewBox }}
    {# => 0 0 25 25 #}

Variables
EmptyFilter 

Name: empty
Parameters: None
Returns: Boolean
Configuration: None

Returns true if a variable is:

null
''
a empty Array
a empty Map
{}
undefined

Example:
    {{ variable|empty }}
    {# => true #}

    {% set variable = 'hi' %}
    {{ variable|empty }}
    {# => false #}

NotEmptyFilter

Name: notEmpty
Parameters: None
Returns: Boolean
Configuration: None

Returns true if a variable is not empty (see EmptyFilter). 
Example:
    {{ variable|notEmpty }}
    {# => false #}

    {% set variable = 'hi' %}
    {{ variable|notEmpty }}
    {# => true #}

GetFilter

Name: get or getProperty
Parameters: 
key: StringThe key of the desired value.


Returns: Mixed
Configuration: None

Returns the value of a object at key. If key does not exist undefined is returned.
Example:
    {{ variable|get('property') }}
    {# => undefined #}

    {% set variable = { property: 'hi' } %}
    {{ variable|get('property') }}
    {# => hi #}

SetFilter

Name: set or setProperty
Parameters: 
key: StringThe key.
value: MixedThe value.      


Returns: Object
Configuration: None

Sets the key of the given object to value. If no object was given a new one will be created and returned.
Example:
    {{ variable|set('property', 'value') }}
    {# => { property: 'value' } #}
    {{ variable|set('property', 'hi') }}
    {# => { property: 'hi' } #}

Formatting
AttributesFilter

Name: customAttributes or attributes
Parameters: 
prefix: StringAll properties names will be prefixed with this


Returns: String
Configuration: None

Iterates over the given object and returns a attribute string. Camel case on keys will be converted to kebab case.
Example:
    {{ { 'foo': 'bar', 'fooBar': 'foo' }|attributes }}
    {# => foo="bar" foo-bar="foo" #}

    {{ { 'foo': 'bar', 'fooBar': 'foo' }|attributes('data') }}
    {# => data-foo="bar" data-foo-bar="foo" #}

FormatDateFilter

Name: formatDate or date
Parameters: 
format: StringA (date format string)[http://momentjs.com/docs/#/displaying/]


Returns: String
Configuration: None

Formats the given date as a string. If format is not specified the global date format will be used.
Example:
    {{ '12.01.2018'|formatDate }}
    {# => 12.01.2018 #}

    {{ '12.01.2018'|formatDate('YYYY-MM-DD') }}
    {# => 2018-01-12  #}

FormatNumberFilter

Name: formatNumber or number
Parameters: 
format: StringA (number format string)[http://numeraljs.com/#format]


Returns: String
Configuration: None

Formats the given number as a string. If format is not specified the global number format will be used.
Example:
    {{ 1000|formatNumber }}
    {# => 1000,00 #}

    {{ 1000|formatNumber('0,0.0000') }}
    {# => 1.000,0000  #}

HyphenateFilter

Name: hyphenate
Parameters: None
Returns: String
Configuration: None

Inserts soft hyphens into the given text. Useful for headlines and short texts.
Example:
    {{ 'hyphenation'|hyphenate }}
    {# => hy|phen|ation #}

MarkdownFilter

Name: markdown
Parameters: None
Returns: String
Configuration: None

Transforms the given markdown into html.
Example:
    {{ '# Hi'|markdown }}
    {# => Hi #}

MarkupFilter

Name: markup
Parameters: 
type: [plain|html]Defines the expected output


Returns: String
Configuration:
styles: ObjectDefines a map of custom names to known types (plain or html)



Transforms the given text into html or plaintext. This filter is used as a abstraction of rte fields known from cms systems.
Example:
    {{ 'Hi'|markup }}
    {# => Hi #}

    {{ 'Hi'|markup('plain') }}
    {# => Hi #}

    {{ 'Hi, how is it?'|markup('html') }}
    {# => Hi, how is it? #}

Data
LoadFilter

Name: load
Parameters: None
Returns: Object
Configuration: None

Loads json files located in the models directory of a entity and processes any macros it finds. To learn more about those macros please see the ViewModel documentation. 
The filter will only load models when given a string that points to valid json file.
You should use the shortform of entity/json (e.g. e-cta/default).
Example:
    {% set model = model|load %}
    {% set model = 'e-cta/primary'|load %}

SettingFilter

Name: setting
Parameters: None
Returns: Object
Configuration: None

Abstracts the idea of global settings that are accessible via a unique string key. To learn more about how to add settings please see the SettingsModel documentation.
Example:
    {% set setting = 'de.entoj.name'|setting %}

TranslateFilter

Name: translate
Parameters: 
...variables: MixedProvides variables for placeholders. The first variable is named {0}


Returns: String
Configuration: None

Provides a simple translation facility that works based on unique identifiers for translations. It supports a simple form of placeholders in the translated strings. To learn more about how to add translations please see the TranslationModel documentation.
Example:
    {{ 'de.entoj.name'|translate }}
    {# => Entoj #} 

    {{ 'de.entoj.greeting'|translate('Darth') }}
    {# => Hi, {0}! => Hi, Darth! #}

MediaQueryFilter

Name: mediaQuery
Parameters: None
Returns: String
Configuration: None

Returns one of the defined media queries and their derivations. The breakpoints are defined via GlobalSettings. It supports the suffixes andBelow and andAbove.
Example:
    {{ 'tablet'|mediaQuery }}
    {# => (min-width: 1024px) and (max-width: 1024px) #} 

    {{ 'tabletAndBelow'|mediaQuery }}
    {# => (max-width: 1024px) #} 

    {{ 'tabletAndAbove'|mediaQuery }}
    {# => (min-width: 1024px) #}

Helper
DebugFilter

Name: debug
Parameters: None
Returns: void
Configuration: None

Outputs a json dump and the type of the given variable.
Example:
    {{ 'de.entoj.name'|debug }}
    {# => string :: "de.entoj.name" #}

LipsumFilter

Name: lipsum
Parameters: None
Returns: void
Configuration: None

Outputs a json dump and the type of the given variable.
Example:
    {{ 'de.entoj.name'|debug }}
    {# => string :: "de.entoj.name" #}

UniqueFilter

Name: unique
Parameters: 
seperator: StringProvides a custom placeholder between the id and the prefix. Defaults to -


Returns: String
Configuration: None

Outputs a request unique id. It uses the given value as a prefix. The default seperator is a dash.
Example:
    {{ 'pre'|unique }}
    {# => pre-1 #}

    {{ 'pre'|unique('#') }}
    {# => pre#2 #}

ModuleClassesFilter

Name: moduleClasses
Parameters: 
moduleClass: StringThe base module class


Returns: String
Configuration: None

Generates BEM compatible class modifiers. If no moduleClass is given a empty string is returned.
Example:
    {{ false|moduleClasses('a-cta') }}
    {# => a-cta #}

    {{ 'primary'|moduleClasses }}
    {# => #}

    {{ 'primary'|moduleClasses('a-cta') }}
    {# => a-cta a-cta--primary #}    

    {{ ['primary', 'active']|moduleClasses('a-cta') }}
    {# => a-cta a-cta--primary a-cta--active #}

user/export/Exporter.html.body:
Artifact exporter 
One of the main goals of entoj is to make the transfer of design systems to content management systems as easy as possible. Ideally this should work fully automated.
This is where the artifact exporters come into play: they take the templates you write for all the patterns, pages and templates and transform them into something the target platform understands. Currently there are exporters for HTML, WordPress (PHP), TWIG, Typo3 (Fluid) and CoreMedia (JSP).
Example:
{% macro e_quote_test(text, author, skin) %}
    {% set moduleClass = 'e-quote' %}
    {% set moduleClasses = [skin]|moduleClasses(moduleClass) %}

        „{{ text }}“        
        {{ author }}

{% endmacro %}

could be exported as HTML

        „42“        
        Deep Thought


Export Types 
There are different content types you may want to export from your pattern lab. Not all exporters support all of these. For example, if the target platform has no concept of reusable page templates (like the HTML exporter) they will not be exported.
Patterns
When exporting patterns you are essentially exporting nunjucks macros. Per default, the main macro (which should be named like the pattern itself) will get exported. If you wish to export any other macro you will have to specify its name in the export configuration. 
Pages
Exporting pages is very useful for static platforms. The exports are not configurable.
Templates
If the target platform has a meaning of templates with content placeholders (like the CM exporter) the exporting of templates is supported. This will help trmendeously
Configuration
The configuration of exporters is divided into module and export configuration. The module configuration provides settings for the exporter itself - mostly for directories and filter presets. Export configurations customize the way entities are exported
Module Configuration 
Exporters may be configured globally and environment specific. Environment configurations will override global configurations.
Global
Global configurations are located in the settings section of the entoj configuration
Example:
// Changing the default export path
configuration.settings.add(
    {
        html:
        {
            exportPath: '${cache}/html'
        }
    });

Environment
Environment specific configurations are located in the respective build configuration
Example:
// Change the export path only for the staging environment
configuration.build.environments.add(
    {
        staging =
        {
            html:
            {
                exportPath: '${cache}/staging'
            }
        }
    }};

Export Configuration 
To export a entity you need to create a entity.json file in the root directory of a entity (e.g. base/atoms/a-link/entity.json) and add a export section. Within that section you can configure each exporter separately. For the examples below we will use the html exporter. 
Export
For each item in export.[] a artifact will be exported. You may configure each export with exporter specific options.
Use global settings to minify repetition of configs

Example:
// Export the entity as example.html and a specific argument for the macro
{
    "export":
    {
        "html":
        [
            {
                "filename": "example.html",
                "arguments":
                {
                    "text": "Lorem ipsum"
                }
            }
        ]
    }
}

Global
To configure the default settings of a entity you can add a export.settings. section. Those settings are global and therefore used whenever the macro is part of an export.
Local settings will override global settings

Example:
// Export the entity two times and with the argument text set to "Lorem Ipsum"
{
    "export":
    {
        "settings":
        {
            "html":
            {
                "arguments":
                {
                    "text": "Lorem ipsum"
                }                             
            }
        },
        "html":
        [
            {
                "filename": "example1.html"
            },
            {
                "filename": "example2.html"
            }            
        ]
    }
}

Macro
When a entity is composed out of other entities you can configure the rendering of those composed entities per export by adding a export.[].settings. section for a local override. If you need to make the override global you can add a export.globals..settings. section.
Example:
// Export the entity as example.html and adds the argument classes 
// with the value "super-special" to all calls to a_link.
// Additonally a_cta will get rendered with classes set to "super-cta"
{
    "export":
    {
        "globals":
        {
            "html":
            {
                "settings":
                {
                    "a_cta": 
                    {
                        "arguments":
                        {
                            "classes": "super-cta"
                        }
                    }
                }                                
            }
        },        
        "html":
        [
            {
                "filename": "example.html",
                "settings":
                {
                    "a_link": 
                    {
                        "arguments":
                        {
                            "classes": "super-special"
                        }
                    }
                }
            }
        ]
    }
}

user/export/JspExporter.html.body:
JSP exporter
A jsp artifact exporter. All configured entities will export their templates as single jsp files. Any macro calls are resolved at runtime via jsp:include.
Feature Support 
Yield macros
Macros calls with custom body content like
{% raw %}{% call macro() %}
    STUFF
{% endcall %}{% endraw %}

are supported by automatically inlining the called macro.
Filter
The table below shows which core nunjucks filters are supported. For details about each filter see the templating documentation.



Filter
Supported
Details




AssetUrlFilter

see jsp.assetBaseUrl


AttributesFilter




DebugFilter




EmptyFilter




FormatDateFilter

uses fmt:formatDate to format the date. The default format is configured via configuration.settings.formats.date


FormatNumberFilter




GetFilter




HyphenateFilter




LinkUrlFilter

uses c:url to generate the link.


LipsumFilter




LoadFilter




MarkdownFilter




MarkupFilter

the content is just passed through


MediaQueryFilter

the exporter will create a helper includes/helper/mediaQueries.jsp that contains a map of all known media query to name mapings


ModuleClassesFilter




NotEmptyFilter




SetFilter




SettingFilter




SvgUrlFilter

see jsp.svgBaseUrl


SvgViewBoxFilter

the exporter will create a helper includes/helper/svgViewBoxes.jsp that contains a map of all known svg files with their viewboxes; see jsp.svgBasePath


TranslateFilter

uses fmt:message to translate strings


UniqueFilter





Install 
Install the node module
$ npm install --save entoj-export-jsp

Register the module (in entoj-configuration.js)
configuration.register(require('entoj-export-jsp'));

Configuration 
Module Configuration 
See module options for a detailed documentation.
Global
Example:
// Full featured Example
configuration.settings.add(
    {
        jsp:
        {
            exportPath: '${cache}/export',
            jspBasePath: 'includes',
            jspBaseUrl: '/includes',
            assetBaseUrl: '/assets/base',
            svgBaseUrl: '/assets/base/icons',
            svgBasePath: '/base/global/assets/icons',
            imageBaseUrl: '/images',
            viewHelperUri: 'http://foo.com/bar',
            viewHelperNamespace: 'bar'
        }
    });

Environment
// Full featured Example
configuration.build.environments.add(
    {
        staging =
        {
            jsp:
            {
                exportPath: '${cache}/export',
                jspBasePath: 'includes',
                jspBaseUrl: '/includes',
                assetBaseUrl: '/assets/base',
                svgBaseUrl: '/assets/base/icons',
                svgBasePath: '/base/global/assets/icons',
                viewHelperUri: 'http://foo.com/bar',
                viewHelperNamespace: 'bar'
            }
        }
    }};

Options 
jsp.exportPath 

Type: String
Global: Yes
Environment: Yes
Default: ${cache}/export

The base path used to store all exported artefacts. Standard directories may be used as variables.
jsp.jspBasePath

Type: String
Global: Yes
Environment: Yes
Default: includes

The base path used to store exported jsp artefacts. This is relative to jsp.exportPath.
jsp.jspIncludePath

Type: String
Global: Yes
Environment: Yes
Default: /includes

The base url used to include jsp artefacts via jsp:include.
jsp.imageBaseUrl

Type: String
Global: Yes
Environment: Yes
Default: ``

Used as the base url for rendering |imageUrl filters.
jsp.assetBaseUrl

Type: String
Global: Yes
Environment: Yes
Default: ``

Used as the base url for rendering |assetUrl filters.
jsp.svgBaseUrl

Type: String
Global: Yes
Environment: Yes
Default: ``

Used as the base url for rendering |svgUrl filters.
jsp.svgBasePath

Type: String
Global: Yes
Environment: Yes
Default: ``

Used as the base path for reading svg icons needed to render |svgViewBox filters.
jsp.viewHelperUri

Type: String
Global: Yes
Environment: Yes
Default: https://entoj.io/entoj

Used as the uri for the main view helper registration.
jsp.viewHelperNamespace

Type: String
Global: Yes
Environment: Yes
Default: entoj

Used as the namespace for the main view helper registration.
Export Configuration 
I am assuming you already read the chapter about the basics of export configurations.
// Full featured Example
{
    "export":
    {
        "settings":
        {
            "jsp":
            {
                "mode": "inline",
                "parameters": 
                {
                    "param": 
                    {
                       "value": "default",
                       "name": "param"
                    }
                }
            }
        },
        "jsp":
        [
            {
                "macro": "name",
                "filename": "name",
                "parameters": 
                {
                    "param": 
                    {
                       "value": "default",
                       "name": "param"
                    }
                },
                "mode": "inline",
                "settings":
                {
                    "macro_name":
                    {
                        "arguments": 
                        {
                            "name": "value"
                        },
                        "mode": "inline"
                    }
                }
            }
        ]
    }
}

Options 
macro

Type: String
Export: Yes
Global: No
Macro: No
Default: The main macro of the entity (e.g. a_text)

Defines the macro that will be exported.
filename

Type: String
Export: Yes
Global: No
Macro: No
Default: ${includePath}/${categoryName}/${macroName}.jsp or ${includePath}/${categoryName}/${entityId}.jsp

Define the filename of the exported macro. The .jsp extensions is added automatically. When no path is specified the default path (the category plural name in lowercase) is prepended.
mode

Type: Enum[include|inline]
Export: No
Global: Yes
Macro: Yes
Default: include

Defines if the macro will be included via jsp:include or inlined at the calling site.
parameters

Type: Array
Export: Yes
Global: Yes
Macro: No
Default: []

Allows to specify parameter default values for macros. This only applies to exporting full macros. If you want to change the arguments of a macro call please see  arguments
arguments 

Type: Array
Export: No
Global: No
Macro: Yes
Default: []

Allows to specify arguments that will be used when calling macros.
Cookbook 
Below you will find a couple of examples to illustrate most of the configuration scenarios you will face in your daily work.
Templates
All examples below are based on the following template files:
base/atoms/a-text/a-text.j2
{##
    @param {String} [label] - The text
    @param {String} [classes] - Any additional classes that will be added to the root element
#}
{% macro a_text(label='', classes='') %}


        {{ label }}


{% endmacro %}

base/molecules/m-imagetext/m-imagetext.j2
{##
    @param {String} [image] - The image url
    @param {String} [label] - The text
    @param {String} [classes] - Any additional classes that will be added to the root element
#}
{% macro m_imagetext(image='', label='', classes='') %}



        {{ a_text(label=label, classes='m-imagetext__image') }}


{% endmacro %}

Default export
Configs
base/atoms/a-text/entity.json
{
    "export":
    {
        "jsp":
        [
            {
            }
        ]
    }
}

Exported
includes/atoms/a-text.jsp














    ${ label }




Custom filenames
Configs
base/atoms/a-text/entity.json
{
    "export":
    {
        "jsp":
        [
            {
                "filename": "custom"
            },
            {
                "filename": "utils/custom"
            }            
        ]
    }
}

Exported
includes/atoms/custom.jsp














    ${ label }




includes/utils/custom.jsp














    ${ label }




Changing default values of parameters
Configs
base/atoms/a-text/entity.json
{
    "export":
    {
        "jsp":
        [
            {
                "parameters": 
                {
                    "classes": "custom"
                }
            }            
        ]
    }
}

Exported
includes/atoms/a-text.jsp














    ${ label }




Inlining macros 
Configs
base/molecules/m-imagetext/entity.json
{
    "export":
    {
        "jsp":
        [
            {
                "filename": "include"
            },
            {
                "filename": "inline",
                "settings":
                {
                    "a_text":
                    {
                        "mode": "inline"
                    }
                }
            }
        ]
    }
}

Exported
includes/molecules/include.jsp
























includes/molecules/inline.jsp




















        ${ label_u1 }






Changing argument values of called macros
Configs
base/molecules/m-imagetext/entity.json
{
    "export":
    {
        "jsp":
        [
            {
                "settings":
                {
                    "a_text":
                    {
                        "arguments":
                        {
                            "classes": "custom"
                        }
                    }
                }
            }
        ]
    }
}

Exported
includes/molecules/m-imagetext.jsp
